import React, { useEffect, useState } from "react";
import { BarChart, Bar, XAxis, YAxis, Tooltip, ResponsiveContainer, CartesianGrid } from "recharts";
import API from "../api";

export default function DashboardHome() {
  const [stats, setStats] = useState({
    users: 0,
    jobs: 0,
    companies: 0,
  });
  const [chartData, setChartData] = useState([]);

  const fetchDashboardData = async () => {
    try {
      const [usersRes, jobsRes, companiesRes] = await Promise.all([
        API.get("/users"),
        API.get("/jobs"),
        API.get("/companies"),
      ]);

      setStats({
        users: usersRes.data.length,
        jobs: jobsRes.data.length,
        companies: companiesRes.data.length,
      });

      // Generate chart data
      setChartData([
        { name: "Users", value: usersRes.data.length },
        { name: "Jobs", value: jobsRes.data.length },
        { name: "Companies", value: companiesRes.data.length },
      ]);
    } catch (err) {
      console.error(err);
    }
  };

  useEffect(() => {
    fetchDashboardData();
  }, []);

  return (
    <div style={{ padding: "20px" }}>
      <h2 style={{ color: "#6b3fa0", marginBottom: "20px" }}>Dashboard Overview</h2>

      {/* Stat Cards */}
      <div
        style={{
          display: "flex",
          gap: "20px",
          marginBottom: "40px",
          flexWrap: "wrap",
        }}
      >
        <div
          style={{
            flex: "1",
            background: "#ede4ff",
            borderRadius: "10px",
            padding: "20px",
            minWidth: "220px",
            boxShadow: "0 2px 8px rgba(0,0,0,0.1)",
          }}
        >
          <h3 style={{ color: "#6b3fa0" }}>Total Users</h3>
          <p style={{ fontSize: "28px", fontWeight: "bold" }}>{stats.users}</p>
        </div>

        <div
          style={{
            flex: "1",
            background: "#e8f6ff",
            borderRadius: "10px",
            padding: "20px",
            minWidth: "220px",
            boxShadow: "0 2px 8px rgba(0,0,0,0.1)",
          }}
        >
          <h3 style={{ color: "#007bff" }}>Total Jobs</h3>
          <p style={{ fontSize: "28px", fontWeight: "bold" }}>{stats.jobs}</p>
        </div>

        <div
          style={{
            flex: "1",
            background: "#fdf2e9",
            borderRadius: "10px",
            padding: "20px",
            minWidth: "220px",
            boxShadow: "0 2px 8px rgba(0,0,0,0.1)",
          }}
        >
          <h3 style={{ color: "#ff8c00" }}>Total Companies</h3>
          <p style={{ fontSize: "28px", fontWeight: "bold" }}>{stats.companies}</p>
        </div>
      </div>

      {/* Chart */}
      <div
        style={{
          background: "#fff",
          padding: "20px",
          borderRadius: "10px",
          boxShadow: "0 2px 8px rgba(0,0,0,0.1)",
          height: "350px",
        }}
      >
        <h3 style={{ color: "#6b3fa0", marginBottom: "10px" }}>
          Graphical Representation
        </h3>
        <ResponsiveContainer width="100%" height="100%">
          <BarChart data={chartData}>
            <CartesianGrid strokeDasharray="3 3" />
            <XAxis dataKey="name" />
            <YAxis allowDecimals={false} />
            <Tooltip />
            <Bar dataKey="value" fill="#6b3fa0" radius={[5, 5, 0, 0]} />
          </BarChart>
        </ResponsiveContainer>
      </div>
    </div>
  );
}
